import React from 'react';





const Charts = () => {
    return(
        <>
        <div>this is chart button</div>

        <Link to="/home">
            <button onClick={handleSubmit} className="btn btn-primary mx-5">
                Login
            </button>
        </Link>
        </>
    );
};

export default Charts;
